  class SearchBoard(object):

  	def __init__(self, rows, cols):
  		self.counts = [[0] * (cols + 2) for _ in xrange(rows + 2)]
  		self.mineCount = 0

  	def addMine(self, row, col):
  		counts = self.counts
  		assert counts[row + 1][col + 1] < 10
  		top = counts[row + 0]
  		top[col + 0] += 1
  		top[col + 1] += 1
  		top[col + 2] += 1
  		mid = counts[row + 1]
  		mid[col + 0] += 1
  		mid[col + 1] += 10
