  		bot[col + 0] += 1
  		bot[col + 1] += 1
  		bot[col + 2] += 1
  		self.mineCount += 1

  	def removeMine(self, row, col):
  		counts = self.counts
  		assert counts[row + 1][col + 1] >= 10
  		top = counts[row + 0]
  		top[col + 0] -= 1
  		top[col + 1] -= 1
  		top[col + 2] -= 1
  		mid = counts[row + 1]
