  		bot = counts[row + 2]
  		bot[col + 0] -= 1
  		bot[col + 1] -= 1
  		bot[col + 2] -= 1
  		self.mineCount -= 1

  	def checkConnected(self):
  		counts = self.counts
  		cols = len(counts[0]) - 2
  		rows = len(counts) - 2

  		for rowIdx, row in enumerate(counts):
  			if rowIdx == 0 or rowIdx > rows:
  				continue
  			try:
  				colIdx = row.index(0, 1, -1)
  			except ValueError:
  				pass
