  				for row in counts[1 : -1]
  				]
  		board[click[0] - 1][click[1] - 1] = 'c'
  		return [''.join(row) for row in board]

  def searchBruteForce(rows, cols, mines):
  	if mines == rows * cols - 1:
  		return ['c' + '*' * (cols - 1)] + ['*' * cols] * (rows - 1)

