  def all_grids(R,C,M, lp=0,placed=0):
      rem = R*C-lp
      if M-placed >= rem:
          if M-placed > rem:
              return None

          res = set()
          for i in range(lp, R*C):
              res.add(i)
          return [res]

      if placed == M:
          return [set()]

      res = []
      for i in range(lp, R*C):
          sub_sol = all_grids(R,C,M,i+1, placed+1)
          if sub_sol is None:
