  def adj(R,C,i):

      res = []
      left_edge = i % C == 0
      top_edge = i // C == 0
      right_edge = (i+1) % C == 0
      bottom_edge = i // C == R-1

      if not left_edge:
          res.append(i-1)
          if not top_edge:
              res.append(i-1-C)
          if not bottom_edge:
              res.append(i+C-1)

      if not right_edge:
          res.append(i+1)
          if not top_edge:
              res.append(i+1-C)
          if not bottom_edge:
              res.append(i+1+C)

      if not bottom_edge:
          res.append(i+C)
      if not top_edge:
          res.append(i-C)
      return res




  def solution(R,C,g):
      M = R*C
      res = []
      num_zeroes = 0
      for i in range(M):
          if i in g:
              res.append('x')
              continue
          x = 0
          for a in adj(R,C,i):
              if a in g:
                  x += 1
          if x == 0:
              num_zeroes += 1
          res.append(x)

      for i in range(M):
          if i in g:
              continue
          r = res[i]
          if r == 0 and num_zeroes == 1:
              continue
          connected = False
          for a in adj(R,C,i):
              if res[a] == 0:
                  connected = True
                  break
          if not connected:
              return None

      return res.index(0)

