          return mines <= rc - 1, 1

      if mines == rc - 1:
          return True, 1  # doesn't matter what to fill

      if mines > rc - 4:
          return False, 0

      if rows == 2:
          return (False, 0) if mines == 1 else (True, 2)
      if cols == 2:
          return (False, 0) if mines == 1 else (True, 1)

      if rows <= cols:
          if mines >= rows:
              return True, 2
          if mines == rows - 1:
              if mines == cols - 1:
                  if rows == 3:
                      return False, 0
                  return True, 4 # L shape fill, most in the column
              else:
                  return True, 1 # fill row
          return True, 2 
      else:
          if mines >= cols:
              return True, 1
          if mines == cols - 1:
              if mines == rows - 1:
                  if cols == 3:
                      return False, 0
                  return True, 3 # L shape fill, most in the row
              else:
                  return True, 2 # fill column
