  def solveit(case):
      rows = case["R"]
      cols = case["C"]
      mines = case["M"]

      b = Board(rows, cols)
      r, c, m = rows, cols, mines

      while m >= 0:
          okgo, howtofill = is_stage_solvable(r, c, m)
          if not okgo:
              return "Impossible"
          if howtofill == 1: # fill row
              b.fill_edge_row(m)
              if m <= c:
                  break # fill and done
              m -= c
              r -= 1
          elif howtofill == 2: # fill column
              b.fill_edge_col(m)
              if m <= r:
                  break # fill and done
              m -= r
              c -= 1
          elif howtofill == 3: # L shape fill, most in the row
              b.fill_edge_row(m - 1)
              b.fill_edge_col(1)
              break # fill and done
          elif howtofill == 4: # L shape fill, most in the column
              b.fill_edge_col(m - 1)
              b.fill_edge_row(1)
              break # fill and done
          else:
              assert False

      return str(b) 



